import React, { useEffect, useState } from "react";
import todo from '../ethereum/todo.js'

const DisplayTasks = () => {

    const [task, setTask] = useState({})

    useEffect(async() => {
        const task = await todo.methods.Tasks(1).call();
        task = task.content;
    }, [])

    return (
        <div>
            {task}
        </div>
    )
}

export default DisplayTasks;
